import styled from "styled-components";
import BottomNavBar from "../../components/shared/BottomNavBar";
import { Container, Avartar, SubText, colors } from "../../Styles";
import MainPicDummy from "../../dummyResources/MainPicDummy.jpg";

interface Props {}

export default function FriendsPage(props: Props) {
  return (
    <ContainerFriends>
      <Heading>
        <b>강남구</b> 근처 친구
      </Heading>
      <FlexDiv>
        <AvartarFriends src={MainPicDummy} />
      </FlexDiv>
      <FlexDiv style>
        <Name>리안</Name>
      </FlexDiv>
      <BottomNavBar selectedItem="friends" />
    </ContainerFriends>
  );
}

const ContainerFriends = styled(Container)`
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  justify-content: center;
  display: flex;
  flex-direction: column;
`;

const FlexDiv = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const AvartarFriends = styled(Avartar)`
  margin-top: 50px;
  width: 200px;
  height: 200px;
`;

const Heading = styled(SubText)`
  margin-top: 60px;
  font-weight: 500;
  font-size: 18px;
  b {
    font-weight: 1000;
  }
`;

const Name = styled.span`
  color: ${colors.Black};
  font-weight: bold;
`;
